import React, { useState, useEffect } from 'react';
import axios from 'axios';

const CreatorPerformance = () => {
  const [creatorData, setCreatorData] = useState({});

  useEffect(() => {
    axios.get('/api/creator-performance').then((response) => {
      setCreatorData(response.data);
    });
  }, []);

  return (
    <div>
      <h3>Creator Performance</h3>
      <p>Top Creators: {creatorData.topCreators}</p>
      <p>GMV per Video: ${creatorData.gmvPerVideo}</p>
      <p>New Content per Creator: {creatorData.newContent}</p>
    </div>
  );
};

export default CreatorPerformance;
